import React from 'react';
import ReactDOM from 'react-dom';
import Title from './components/Title.js';
import ResearchBar from './components/ResearchBar.js';
import CityCard from './components/CityCard.js';
import Footer from './components/Footer.js';
import City_illustration from './components/City_illustration.js';
import reportWebVitals from './reportWebVitals';
import styles from './components/App.css';
import logo_Tallinn from './pictures/Tallinn.jpg'



ReactDOM.render(
  <React.StrictMode>
    <Title />
    <ResearchBar />
    <CityCard city_name = "Tallinn"/>
    <City_illustration path = '../pictures/Tallinn.jpg'/>
    <CityCard city_name = "Paris"/>
    <CityCard city_name = "Berlin"/>



  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
